import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import './PatientDetail.css';

const PatientDetail = () => {
  const { id } = useParams();
  const [patient, setPatient] = useState(null);
  const [thingspeakData, setThingspeakData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch patient data first
        const patientResponse = await fetch(`http://localhost:8000/${id}`);
        if (!patientResponse.ok) {
          throw new Error('Failed to fetch patient data');
        }
        const patientData = await patientResponse.json();
        setPatient(patientData);

        // Then fetch ThingSpeak data
        const APIkey = "MWFBV98HOZOHTHY4";
        const thingspeakResponse = await fetch(
          `https://api.thingspeak.com/channels/${id}/feeds.json?api_key=${APIkey}&results=1`
        );

        if (!thingspeakResponse.ok) {
          throw new Error('Failed to fetch ThingSpeak data');
        }

        const thingspeakJson = await thingspeakResponse.json();
        if (thingspeakJson.feeds?.length > 0) {
          setThingspeakData(thingspeakJson.feeds[0]);
        } else {
          setThingspeakData(null);
        }

        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchData();
    const interval = setInterval(fetchData, 30000);
    return () => clearInterval(interval);
  }, [id]);

  if (loading) {
    return <div className="loading">Loading patient data...</div>;
  }

  if (error) {
    return <div className="error">Error: {error}</div>;
  }

  if (!patient) {
    return <div className="error">Patient not found</div>;
  }

  return (
    <div className="patient-detail-container">
      <div className="patient-detail-header">
        <Link to="/" className="back-button">← Back to Dashboard</Link>
        <h2>Patient Details</h2>
      </div>

      <div className="patient-info-section">
        <div className="patient-profile">
          <h3>Patient Information</h3>
          <div className="info-grid">
            <div className="info-item">
              <span className="label">Name:</span>
              <span className="value">{patient.name}</span>
            </div>
            <div className="info-item">
              <span className="label">Phone Number:</span>
              <span className="value">{patient.phone_number}</span>
            </div>
            <div className="info-item">
              <span className="label">Patient ID:</span>
              <span className="value">{patient.unique_id}</span>
            </div>
            <div className="info-item">
              <span className="label">Age:</span>
              <span className="value">{patient.age}</span>
            </div>
          </div>
        </div>

        {thingspeakData && (
          <div className="thingspeak-data">
            <h3>Sensor Data</h3>
            <div className="info-grid">
              {Object.entries(thingspeakData).map(([key, value]) => (
                key !== 'created_at' && key !== 'entry_id' && (
                  <div className="info-item" key={key}>
                    <span className="label">{key}:</span>
                    <span className="value">{value}</span>
                  </div>
                )
              ))}
              <div className="info-item">
                <span className="label">Last Updated:</span>
                <span className="value">
                  {new Date(thingspeakData.created_at).toLocaleString()}
                </span>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default PatientDetail;
